import React from "react";

const IconProfile = () => {
  return (
    <svg
      width={44}
      height={44}
      viewBox="0 0 44 44"
      fill="none"
      xmlns="http://www.w3.org/2000/svg"
    >
      <circle
        cx={22}
        cy={19}
        r={3}
        stroke="currentColor"
        strokeWidth={2}
        strokeLinecap="round"
      />
      <circle cx={22} cy={22} r={11} stroke="#A2A2A8" strokeWidth={2} />
      <path
        d="M29 30C28.5871 28.8525 27.6773 27.8384 26.4117 27.1152C25.146 26.392 23.5953 26 22 26C20.4047 26 18.854 26.392 17.5883 27.1152C16.3227 27.8384 15.4129 28.8525 15 30"
        stroke="#A2A2A8"
        strokeWidth={2}
        strokeLinecap="round"
      />
    </svg>
  );
};

export default IconProfile;
